    genMosaik: function() {
        let path = window.location.origin + '/';

        $('.btn_new_gen').on('click', function() {
            $('.preview_img img').each(function(ind, el) {
                $(this).attr('src', path + 'img/default_mosaik.jpg');
                $(this).parent().attr('data-color', '');
                $(this).parent().attr('data-code', '');
            });
            $('.order .btn_down').removeClass('active');
            $('.order .btn_order').removeClass('active');
            $('.preview_img').removeClass('choosen');
            $('.btn_gen').removeClass('active');
            $('#canvas').removeClass('show');
            $('.range_color').slider( "value", 0 );
            $('.value_color').text('');
            $('.code_gen').text('');
            $('.code_input').val('');
            const ctx = canvas.getContext("2d");
            ctx.clearRect(0, 0, canvas.width, canvas.height)
        })
        $('.btn_gen').on('click', function() {
            let colArray = [];
            $('.preview_img').each(function(ind, el) {
                colArray.push({ 'color': $(el).attr('data-color'), 'value': $(el).parents('.item_color').find('.value_color').text() });
            });
            let color = [];
            colArray.forEach(function(item, i, arr) {
                if (item.value > 0) {
                    for (let j = 0; j < item.value; j += 5) {
                        color.push(item.color);
                    }
                }
                $('canvas').addClass('bg');
            });
            drawMozaic(color);
            $('.order .btn_down').addClass('active');
            $('.order .btn_order').addClass('active');
            let code_gen = '';
            $('.preview_img').each(function(ind, el) {
                let code = $(this).attr('data-code');
                let val = $(this).next().find('.range_color').slider('value');
                if(code && val) {
                    code_gen += code + val + '-';
                }
            });
            code_gen = code_gen.slice(0, -1);
            // $('.code_gen').text(code_gen);
            let code_genTmp = 'LC0140-LC0930-LC2720-LC1710'
            $('.code_gen').text(code_genTmp);
            $('.code_input').val(code_gen);
            $('#canvas').addClass('show');
        });

        function drawMozaic(color) {
            const ctx = canvas.getContext("2d");
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            let colCopy;
            let sources = [path + "img/part_mosaik/0-5.png", path + "img/part_mosaik/5-10.png", path + "img/part_mosaik/10-15.png", path + "img/part_mosaik/15-20.png", path + "img/part_mosaik/20-25.png", path + "img/part_mosaik/25-30.png", path + "img/part_mosaik/30-35.png", path + "img/part_mosaik/35-40.png", path + "img/part_mosaik/40-45.png", path + "img/part_mosaik/45-50.png", path + "img/part_mosaik/50-55.png", path + "img/part_mosaik/55-60.png", path + "img/part_mosaik/60-65.png", path + "img/part_mosaik/65-70.png", path + "img/part_mosaik/70-75.png", path + "img/part_mosaik/75-80.png", path + "img/part_mosaik/80-85.png", path + "img/part_mosaik/85-90.png", path + "img/part_mosaik/90-95.png", path + "img/part_mosaik/95-100.png"];
            //let color = [32, 48, 64, 96, 128, 150, 200];
            //let color = ["#f00", "#ff0", "#fff", "#f0f", "#0ff"];
            for (let i = 0; i < sources.length; i++) {
                const image = new Image;
                image.src = sources[i];
                image.onload = () => {
                    colCopy = imageToCanvas(image);
                    // const scale = canvas.height / image.naturalHeight; 
                    // ctx.scale(scale, scale);
                    ctx.drawImage(colCopy, 0, 0, 532, 405);
                    //for (let i = 32; i < 360; i += 32) {
                    restoreImage(colCopy, image);
                    colorImage(colCopy, color[i]);
                    //colorImage(colCopy, "hsl(" + 0 + ",100%,50%)");
                    maskImage(colCopy, image);
                    ctx.drawImage(colCopy, 0, 0, 532, 405);
                    // }
                }
            }
        }

        function imageToCanvas(image) {
            const c = document.createElement("canvas");
            c.width = image.naturalWidth;
            c.height = image.naturalHeight;
            c.ctx = c.getContext("2d"); // attach context to the canvas for easy reference
            c.ctx.drawImage(image, 0, 0);
            return c;
        }

        function restoreImage(dest, source) {
            dest.ctx.clearRect(0, 0, dest.width, dest.height);
            dest.ctx.drawImage(source, 0, 0);
            return dest;
        }

        function colorImage(dest, color) { // image is a canvas image
            dest.ctx.fillStyle = color;
            dest.ctx.globalCompositeOperation = "multiply";
            dest.ctx.fillRect(0, 0, dest.width, dest.height);
            dest.ctx.globalCompositeOperation = "source-over";
            return dest;
        }

        function maskImage(dest, source) {
            dest.ctx.globalCompositeOperation = "destination-in";
            dest.ctx.drawImage(source, 0, 0);
            dest.ctx.globalCompositeOperation = "source-over";
            return dest;
        }
    },
