                doc.addImage(imgData, 'JPEG', 150, 218, 305, 228);

                doc.addFont('MyriadPro-Regular.ttf', 'MyriadPro', 'normal');
                doc.setFont('MyriadPro');
                
                let d = new Date();
                let h = d.getHours();
                let m = d.getMinutes(); 
                let dd = d.getDate();
                let mm = d.getMonth()+1; 
                let yyyy = d.getFullYear();
                let dateOrder = h+':'+m+' '+dd+'.'+mm+'.'+yyyy+'p.';
                doc.text(345, 207, dateOrder); //date

                let name = $("#order_form [name='name']").val();
                doc.text(50, 537, name); //name
                let phone = $("#order_form [name='phone']").val();
                doc.text(50, 597, phone); //phone
                let city = $("#order_form [name='city']").val();
                doc.text(318, 537, city); //city
                let squere = $("#order_form [name='square']").val();
                doc.text(318, 597, squere); //squere
                let code = $("#order_form [name='code']").val();
                doc.text(255, 475, code); //code
